export default(c,n)=>{const r=document.querySelector(c),e=document.querySelector(n);r.addEventListener("change",function(){const o=new URL(window.location.href);o.searchParams.set("tenant",r.value),e.disabled=!0,fetch(o).then(t=>t.text()).then(t=>{const s=new DOMParser().parseFromString(t,"text/html").querySelector(n);e.innerHTML=s.innerHTML||"",e.disabled=!1,e.dispatchEvent(new Event("change"))})})};
